ack layer, pitting. \nAn Exacto knife was used to determine color.',NULL,NULL,NULL,NULL,NULL),('4S010AR0001','4S010','AR',0,1,NULL,'glass',NULL,'1',NULL,NULL,NULL,2,'Glass vessel, handle. Roman-Byzantine. Fragment.\nCobalt blue, opaque red inclusions, light weathering, silica.\nL 41.6, W 17.73. Measurement taken at thickest part of handle\'s base.',NULL,NULL,NULL,NULL,NULL),('4S019AR0006','4S019','AR',0,6,NULL,'glass',NULL,'1',NULL,NULL,NULL,5,'Window glass? Modern (indeterminate period). Fragment.\nLight green, no weathering, no silica. \nL 8.78, W 5.54',NULL,NULL,NULL,NULL,NULL),('4S019AR0011','4S019','AR',0,11,NULL,'glass',NULL,'1',NULL,NULL,NULL,7,'Indeterminate glass fragment. Indeterminate period.\nOpaque teal, very light weathering, silica.\nL 7.49, W 5',NULL,NULL,NULL,NULL,NULL),('4S020AR0001','4S020','AR',0,1,NULL,'glass',NULL,'1',NULL,NULL,NULL,2,'Glass vessel, bowl, body shard. Hellenistic. Fragment.\nClear, decolorized, very heavy weathering, silica, white layer, black layer.\nL 11.19, W 8.77',NULL,NULL,NULL,NULL,NULL),('4S025AR0022','4S025','AR',0,22,NULL,'glass',NULL,'1',NULL,NULL,NULL,2,'Glass bottle, rim sherd. Modern. Fragment.\nBrown, heavy weathering, silica, white layer.\nL 25.82, W 22.03',NULL,NULL,NULL,NULL,NULL),('5S306AR0001','5S306','AR',0,1,'2015-05-29','Glass',NULL,'1',NULL,NULL,NULL,2,'Glass vessel, body sherd. Hellenistic or Early Roman. Fragment.\nClear, very heavy weathering, silica, white layer, black layer, pitting.',NULL,NULL,NULL,NULL,NULL),('5S309AR0008','5S309','AR',0,8,'2015-06-02','Glass',NULL,'1',NULL,'13.77',NULL,2,'Glass bottle or bowl, base shard. Roman. Fragment.\nGreenish-yellow, heavy weathering, silica, white layer, pitting. The bottom curves up and back down on this fragment.\nL 20.47, W 27.45',NULL,NULL,NULL,NULL,NULL),('5S309AR1401','5S309','AR',14,1,'2015-06-08','2 pieces with same AR',NULL,'1',NULL,'13.34',NULL,2,'Glass vessel, body sherd, unknown type. Roman. Fragment.\nGreenish-yellow, heavy weathering, silica, w