,NULL,NULL,NULL),('7S212AR0101','7S212','AR',1,1,'2017-06-12','glass fragments (2 pieces with same AR)',NULL,'1','M9',NULL,NULL,2,'Glass vessel, bowl, rim shard, incised, groove along inside edge. Hellenistic. Fragment.\nClear, heavy weathering, silica, white layer, black layer.\nL 27.15, W 25.08',NULL,NULL,NULL,NULL,NULL),('7S212AR0102','7S212','AR',1,2,'2017-06-12','glass fragments (2 pieces with same AR)',NULL,'1','M9',NULL,NULL,2,'Glass vessel, hollow ring base. Roman. Fragment.\nBlue-green, medium weathering, silica, white layer.\nL 22.59, W 15.56',NULL,NULL,NULL,NULL,NULL),('7S224AR0002','7S224','AR',0,2,NULL,'glass',NULL,'1',NULL,NULL,NULL,3,'Glass bead, polished. Ottoman or later. Complete.\nBrown but looks clear when held up to the light, no weathering.\nL 6.76, W 2.88\nUneveness in perforation causes doubt in date.',NULL,NULL,NULL,NULL,NULL),('8S003AR0001','8S003','AR',0,1,'2018-05-28','Glass fragments',NULL,'1','E/F9',NULL,NULL,2,'Glass vessel, body shard. Roman. Fragment.\nBlue-green, heavy weathering, silica, white layer.',NULL,NULL,NULL,NULL,NULL),('8S006AR0003','8S006','AR',0,3,'2018-06-20','glass artifact',NULL,'1',NULL,NULL,NULL,2,'Glass lamp, body shard, pontil mark. Byzantine-Medieval. Fragment.\nPinkish-tan, heavy weathering, silica, white layer, black layer, pitting. \nL 42.15, W 12.6\nIt is difficult to determine color due to the dirt inside the seam and the silica. The piece that would break off during rapping is still attached with the seam open. This could be an imperfect piece or something that broke during production.',NULL,NULL,NULL,NULL,NULL),('8S065AR0001','8S065','AR',0,1,'2018-06-17','Glass base',NULL,'1',NULL,NULL,NULL,1,'Glass base Alysia has not seen',NULL,NULL,NULL,NULL,NULL),('8S166AR0006','8S166','AR',0,6,'2018-06-15','Glass bead',NULL,'1',NULL,'15.84',NULL,3,'Glass bead, fluted. Roman. Complete (small chunk missing).\nBlue-green, heavy weathering, silica, white layer, pitting. \nL 5.48, W 7.27. L is height and W is diameter.\nT